const input = [
    '',
    '',
    '',
    '',
    ''
];

// [row][col]
const buttons = [
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
];

//start in the middle
var row = 1;
var col = 1;

function clamp(min, max) {
    return function(val) {
        return Math.min(Math.max(val, min), max);
    }
}

const clampButtons = clamp(0,2);

input.forEach((line) => {
    line.split('').forEach((direction) => {
        switch (direction) {
            case 'U':
                row = clampButtons(--row);
                break;
            case 'D':
                row = clampButtons(++row);
                break;
            case 'L':
                col = clampButtons(--col);
                break;
            case 'R':
                col = clampButtons(++col);
                break;
        }
    });
    console.log(`Push ${buttons[row][col]}`);
});
